import './Catalogue.css';

function Catalogue(){
    
    return(
        <div><center>
        Food Catagory: <select>
            <option>VEG</option>
            <option>NON - VEG</option>
        </select><br></br><br></br>
        Food Name: <input type="text" placeholder="enter the food" required/><br></br><br></br>
        Price: <select>
            <option>Cash</option>
            <option>Card</option>
            <option>UPI</option>
        </select><br></br><br></br>


        
    
        </center></div>
    )
}
export default Catalogue;
